import React, { useState, useEffect, useRef } from 'react';
import { Link } from 'react-router-dom';
import anime from 'animejs/lib/anime.es.js';
import Footer from './footer';

const HomePage = () => {
  const [isMobileView, setIsMobileView] = useState(false);
  const textWrapperRef = useRef(null);

  useEffect(() => {
    const handleResize = () => {
      setIsMobileView(window.innerWidth <= 1050);
    };

    const animateText = () => {
      if (textWrapperRef.current) {
        textWrapperRef.current.innerHTML = textWrapperRef.current.textContent.replace(/\S/g, "<span class='letter'>$&</span>");
        anime.timeline({ loop: true })
          .add({
            targets: '.ml13 .letter',
            translateY: [50, 0],
            opacity: [0, 1],
            easing: 'easeOutExpo',
            duration: 1000,
            delay: (el, i) => 50 * i,
          })
          .add({
            targets: '.ml13 .letter',
            translateY: [0, -50],
            opacity: [1, 0],
            easing: 'easeInExpo',
            duration: 800,
            delay: (el, i) => 50 * i,
          });
      }
    };

    handleResize();
    animateText();

    window.addEventListener('resize', handleResize);
    return () => {
      window.removeEventListener('resize', handleResize);
    };
  }, []);

  const commonStyle = {
    color: '#0f0', // Green text
    backgroundColor: '#222', // Dark grey background
    fontFamily: "'Courier New', Courier, monospace", // Monospace font
  };

  const gridStyle = {
    position: 'absolute',
    top: 0,
    left: 0,
    width: '100%',
    height: '100%',
    backgroundImage: 'linear-gradient(#333 1px, transparent 1px), linear-gradient(90deg, #333 1px, transparent 1px)',
    backgroundSize: '20px 20px',
    zIndex: 0,
  };

  const buttonStyle = {
    display: 'inline-block',
    color: '#0f0',
    border: '2px solid #0f0',
    padding: '10px 20px',
    textDecoration: 'none',
    textAlign: 'center',
    margin: '0 10px',
    fontSize: isMobileView ? '14px' : '16px',
    backgroundColor: 'transparent',
    transition: 'all 0.3s ease-in-out',
  };

  const buttonHoverStyle = {
    backgroundColor: '#0f0',
    color: '#222',
  };

  return (
    <div style={{ ...commonStyle, minHeight: '100vh', overflow: 'hidden', position: 'relative' }}>
      <div style={gridStyle}></div>
      <header style={{ padding: '2rem', zIndex: 1 }}>
        <h1 style={{ fontSize: isMobileView ? '20px' : '32px', fontWeight: 'bold' }}>
          Welcome to My Retro Portfolio
        </h1>
        <p style={{ fontSize: isMobileView ? '16px' : '20px' }}>
          Hi, I’m Mohammed! A data analyst and developer.
        </p>
      </header>

      <section ref={textWrapperRef} className="ml13" style={{ margin: '2rem 0', zIndex: 1 }}>
        Available to work<br />
        <span style={{ fontSize: '16px' }}>Flexible salary</span>
      </section>

      <div style={{ zIndex: 1 }}>
        <Link
          to="/about"
          style={buttonStyle}
          onMouseEnter={(e) => Object.assign(e.target.style, buttonHoverStyle)}
          onMouseLeave={(e) => Object.assign(e.target.style, buttonStyle)}
        >
          About Me
        </Link>
        <a
          href="https://react--portfolio.s3.eu-west-2.amazonaws.com/Mohammed+Bakhshi+CV+.pdf"
          download="Mohammed_Bakhshi_CV.pdf"
          target="_blank"
          rel="noopener noreferrer"
          style={buttonStyle}
          onMouseEnter={(e) => Object.assign(e.target.style, buttonHoverStyle)}
          onMouseLeave={(e) => Object.assign(e.target.style, buttonStyle)}
        >
          View CV
        </a>
      </div>

      {/* Add a fake terminal display */}
      <div
        style={{
          marginTop: '2rem',
          padding: '1rem',
          border: '1px solid #0f0',
          borderRadius: '5px',
          backgroundColor: '#333',
          color: '#0f0',
          fontSize: '14px',
          width: isMobileView ? '90%' : '50%',
          marginLeft: 'auto',
          marginRight: 'auto',
          zIndex: 1,
        }}
      >
        <p>System Log:</p>
        <p>[2024-11-18] Welcome to the Retro Portfolio Interface.</p>
        <p>[2024-11-18] User status: Available to work.</p>
        <p>[2024-11-18] Connection: Secure.</p>
      </div>

      <Footer />
    </div>
  );
};

export default HomePage;
